import React, {Component} from 'react';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Home from "../Home/Home";

class RouteBlock extends Component {
  render() {
    return (
      <>
        <Router>
          <Switch>
            <Route path="/">
              <Home />
            </Route>
          </Switch>
        </Router>
      </>
    )
  }
}

export default RouteBlock;
